import './App.css';
import main from "./pages/Main/main";

import { Route, BrowserRouter } from "react-router-dom";

function App() {
  return (
    <>
        <main/>
      <BrowserRouter>
          <Route exact path="/a" component={main}/>
      </BrowserRouter>
    </>
  );
}

export default App();
